import React from 'react';
import Product from './Product.js'
import vschoolProduc from './jokesData.js'

function App() {

    const jokeComponents = jokesData.map(num => {
            return( 
                <Joke question={num.question} answer={num.answer} />
                )
            })
    return(
        <div>
            {jokeComponents}
        </div>
    )
}
export default App;
